    /// <summary>
    /// Loader 资源包读取器
    /// </summary>
    internal class ChimeraLoaderPak
    {
        private readonly string _pakPath;
        private readonly Dictionary<string, (long offset, int compSize, int origSize)> _index;

        public ChimeraLoaderPak(string pakPath)
        {
            _pakPath = pakPath;
            _index = new Dictionary<string, (long, int, int)>(StringComparer.OrdinalIgnoreCase);
            LoadIndex();
        }

        private void LoadIndex()
        {
            using (var fs = new FileStream(_pakPath, FileMode.Open, FileAccess.Read))
            using (var br = new BinaryReader(fs))
            {
                // Magic
                byte[] magic = br.ReadBytes(4);
                if (Encoding.ASCII.GetString(magic) != "CPAK")
                    throw new InvalidDataException("Invalid PAK file");

                // Version
                uint version = br.ReadUInt32();
                if (version != 1)
                    throw new InvalidDataException("Unsupported PAK version");

                // Count
                uint count = br.ReadUInt32();

                // Index entries
                for (int i = 0; i < count; i++)
                {
                    byte[] platformBytes = br.ReadBytes(32);
                    string platform = Encoding.UTF8.GetString(platformBytes).TrimEnd('\0');
                    long offset = br.ReadInt64();
                    int compSize = br.ReadInt32();
                    int origSize = br.ReadInt32();
                    _index[platform] = (offset, compSize, origSize);
                }
            }
        }

        public byte[] GetLoader(string platform)
        {
            if (!_index.TryGetValue(platform, out var entry))
                return null;

            using (var fs = new FileStream(_pakPath, FileMode.Open, FileAccess.Read))
            {
                fs.Seek(entry.offset, SeekOrigin.Begin);
                byte[] compressed = new byte[entry.compSize];
                fs.Read(compressed, 0, entry.compSize);

                // GZip 解压
                using (var input = new MemoryStream(compressed))
                using (var gzip = new GZipStream(input, CompressionMode.Decompress))
                using (var output = new MemoryStream())
                {
                    gzip.CopyTo(output);
                    return output.ToArray();
                }
            }
        }

        public bool HasLoader(string platform)
        {
            return _index.ContainsKey(platform);
        }
    }
